import Layout from "../components/layout";
import PraxisText from "../components/praxisText";
import { motion } from "framer-motion";

const Praxis = () => {
	return (
		<Layout>
			<motion.div exit={{ opacity: 0 }} className='container'>
				<PraxisText></PraxisText>
			</motion.div>
		</Layout>
	);
};

export default Praxis;
